import { useParams } from 'react-router-dom';
import '../assets/css/index.css';

const [searchParams, setSearchParams] = useSearchParams();
const id = searchParams.get("id");


function App() {

  const {id} = useSearchParams();

  return (
    <div className="App">
      <h1>{ id }</h1>
    </div>
  );
}

export default App;
